script: |
  super -f text -I q2750.spq | sort > q2750.out

inputs:
  - name: q2750.spq
    data: |
      SELECT DISTINCT + - 5 + - + ( - + col1 ) * col0, - 85 AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q2750.out
    data: |
      1210	-85
      1822	-85
      92	-85
